const BeerIndex = (props) => {

    const [workouts, setWorkouts] = useState([]);

    const fetchBeer = () => {

        fetch('http://localhost:3002/api/log', {
            method: 'GET',
            headers: new Headers({
                'Content-Type': 'application/json',
                'Authorization': props.token
            })
        }).then(
            (res) => res.json()
        ).then((logData) => {
            setWorkouts(logData);
            console.log(logData)
        })
    }
